To perform case-sensitive sorting in JavaScript, a simple approach is to use the `localeCompare()` method or the `sort()` method with a custom comparison function. Here are examples of both methods:

### Using `localeCompare()`

```javascript
const strings = ["Apple", "apple", "Banana", "banana"];

strings.sort((a, b) => a.localeCompare(b));

console.log(strings);
// Output: ["Apple", "Banana", "apple", "banana"]
```

### Using `sort()` with a custom comparison function

```javascript
const strings = ["Apple", "apple", "Banana", "banana"];

strings.sort((a, b) => {
  if (a < b) return -1;
  if (a > b) return 1;
  return 0;
});

console.log(strings);
// Output: ["Apple", "Banana", "apple", "banana"]
```

In both examples, the sorting is case-sensitive, meaning that uppercase letters come before lowercase letters.

If you want to sort in a case-insensitive manner, you can convert both strings to lowercase or uppercase before comparing them:

```javascript
const strings = ["Apple", "apple", "Banana", "banana"];

strings.sort((a, b) => a.toLowerCase().localeCompare(b.toLowerCase()));

