However, this doesn't work as expected. When I hover over a Tooltip, it opens the previously opened Tooltip instead of the current one. I think this is because the `tooltip` state is not updated immediately.

How can I fix this issue?

Answer:

You are correct that the issue is due to the asynchronous nature of state updates in React. One way to solve this is to use the `useCallback` hook to memoize the `openTooltip` and `closeTooltip` functions, so that they always refer to the latest `tooltip` state.

Here's the updated code:

\begin{code}
// TooltipContext.js
import { createContext, useState, useCallback } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const openTooltip = useCallback((tooltip) => {
    setTooltip(tooltip);
  }, []);

  const closeTooltip = useCallback(() => {
    setTooltip(null);
  }, []);

  return (
    <TooltipContext.Provider value={{ tooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
\end{code}

By using `useCallback` with an empty dependency array, we ensure that the `openTooltip` and `closeTooltip` functions are only recreated when the component mounts, and always refer to the latest `tooltip` state.

With this change, your code should work as expected. When you hover over a Tooltip, it should open the correct Tooltip and close the previously opened one.

