const bookTitle = 'The Great Gatsby';
const bookAuthor = 'F. Scott Fitzgerald';

// ...
```
In this example, the book title and author are hardcoded as English strings. This is an i18n violation because it assumes that all users will be viewing the content in English.

**Example 2: Inconsistent File Naming**

In a file named `bookList.en.js`, we have the following code:
```javascript
// bookList.en.js
const bookList = [
  { title: 'The Great Gatsby', author: 'F. Scott Fitzgerald' },
  { title: 'To Kill a Mockingbird', author: 'Harper Lee' },
  // ...
];
```
In this example, the file name `bookList.en.js` suggests that it contains English translations, but the file content is not properly separated from the code. This can lead to issues when trying to translate the content for other languages.

